           ,1
	from @prValsCAT
	
INSERT INTO [dbo].[STORAGE_IDENTIFIER_PR_VALUE]
           ([SID_ID]
           ,[PREDEFINED_VALUE]
           ,[CREATE_USER]
           ,[CREATE_TIMESTAMP]
           ,[UPDATE_USER]
           ,[UPDATE_TIMESTAMP]
           ,[STATUS])
     select
           @quaSidId
           ,Val
           ,@updateUser
           ,getdate()
           ,@updateUser
           ,getdate()
           ,1
	from @prValsQUA

insert into PRODUCT_SID_SID_VALUE (PRODUCT_SID_ID, PREDEFINED_SID_VALUE_ID)	
	select psi.PRODUCT_STORAGE_IDENTIFIER_ID, sipv.STORAGE_IDENTIFIER_PR_VALUE_ID
	from PRODUCT_STORAGE_IDENTIFIER psi, STORAGE_IDENTIFIER_PR_VALUE sipv
	where psi.SID_ID=sipv.SID_ID and psi.SID_ID in (@catSidId, @quaSidId)	
	
update STORAGE_IDENTIFIER set VALUE_TYPE = 'System.String[], mscorlib' where STORAGE_IDENTIFIER_ID in (@catSidId, @quaSidId)

update sic set
	_KEY_ = dbo.[SetSidKeyValue](_KEY_, @catSidId, @newCatValue),
	HASH_KEY = CAST(hashbytes('SHA1', dbo.[SetSidKeyValue](_KEY_, @catSidId, @newCatValue)) AS BINARY(20)),
	UPDATE_TIMESTAMP = GETDATE(),
	UPDATE_USER = @updateUser
	FROM STOCK_INFO_CONFIG sic, STOCK_INFO_SID sis
	WHERE sis.STOCK_INFO_CONFIG_ID = sic.STOCK_INFO_CONFIG_ID AND sis.SID_ID = @catSidId and sis.[VALUE] = @oldCatValue

update STOCK_INFO_SID set
	[VALUE] = @newCatValue,
	UPDATE_TIMESTAMP = GETDATE(),
	UPDATE_USER = @updateUser
	WHERE SID_ID = @catSidId and [VALUE] = @oldCatValue

	COMMIT
END TRY
BEGIN CATCH
	IF @@TRANCOUNT > 0
		ROLLBACK
		SELECT ERROR_NUMBER() as ErrorNumber, ERROR_MESSAGE() as ErrorMessage
END CATCH

